import React from 'react';

const ClothingOptions = ({ onClothingSelect }) => {
  return (
    <div className="clothing-options">
      <h3>Chọn quần áo:</h3>
      <button onClick={() => onClothingSelect('0ZXTEM110049NWHX-pdp-1-removebg-preview.png')}>Thử áo</button>
      <button onClick={() => onClothingSelect('pants.png')}>Thử quần</button>
    </div>
  );
};

export default ClothingOptions;
